import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import Principal from './pages/Principal';


export default function Routes(){
    return(
        <BrowserRouter>
            <Route path="/" exact component={Principal} />
        </BrowserRouter>
    );
}
